    gotovideoroom(1);
  };
  return (
    <div>
      <p>hello there </p>
      {videoroom === 0 ? (
        <div>
          <p>hello </p>
          <button onClick={joinvideochat}></button>
        </div>
      ) : (
        <Videochatroom />
